text:
//2018//it’s a wrap//✌🏻
:
//seems like my haul days//were the most popular of my insta posts//this year//!
:
//omgoodiness//the sourcing adventures//the hours spent fossicking//the road trips//the kms and countless travel coffees//!
:
//not to mention//hours of polishing//photographing//&//presenting my preloved goodies// 🌟
:
//a lot goes on behind the scenes in my little business//to enable me to offer good quality items//so you can have something different and uniquely repurposed//rather than from commercialised mass production//
:
//i’ve met some amazing peeps this year//customers and followers//other small business owners//amazing artisans & craftsmen//not to mention some very unique humans whom i’ve managed to source from//!
:
//i’m delighted that hundreds of my//preloved goodies//have found new loves this year//via my insta account and my etsy store//
:
//deeply grateful & appreciative//🧡
:
//2019//will kick off tomorrow with another haul post//🙌🏻
:
//in the mean time//enjoy celebrating in the new year//✨🌟✨
:
//take care//
:
//kind regards...trudy//🌿
:
=>==>===>caughtmyeyevintage<===<==<=

